import React from "react";
function ImagePopup() {
    return (
      <div className={`popup ${props.name}-popup ${props.isOpen ? `popup_opened` : ""} `} id={`${props.id}`}>
        <article className="image-card">
          <button
            className="image-card__close popup__close button-hover"
            type="button"
          ></button>
          <img
            className="image-card__photo"
            src="https://pictures.s3.yandex.net/frontend-developer/cards-compressed/baikal.jpg"
            alt="Фото посещенного места"
          />
          <h2 className="image-card__title">Байкал</h2>
        </article>
      </div>
    )
}
export default ImagePopup;
